import { useState } from 'react'
import {Radio, RadioGroup } from '@headlessui/react'
import { CheckIcon, XMarkIcon as XMarkIconMini } from '@heroicons/react/20/solid'
import AOS from 'aos';
import 'aos/dist/aos.css';

AOS.init({
    duration: 500,
    once: true,
    });

export default function Social() {

  return (
  <div className="flex flex-col items-center justify-start w-[80vw] text-white h-[70vh]" id="social-section">
    <h1 className='mt-20 text-4xl font-bold' data-aos="fade-up">Nuestras Redes</h1>
    <p className='mt-4 text-xl font-regular' data-aos="fade-up">
      Contactanos tanto por Instagram como por WhatsApp para adquirir tus monedas al mejor precio del mercado.
    </p>
  </div>
  )
}
